import One from "./one"



let red="red"
let green="green"

function Task(){
    const on="ONN"
    const off="OFF"
    return(
        <div>
            <p>Karthikis good Boy</p>
            <One onn={on} of={off} red={red} green={green}/>
        </div>
    )
}
export default Task;
